INSERT INTO "api_fleetguru" VALUES (1,'FleetGuru','Being proactive by adhering to a Preventative Maintenance Schedule can reduce repair costs by up to 25%.',NULL,'maintenance'),(2,'FleetGuru','By knowing your optimum replacement cycle you can greatly decrease your purchase costs through factory ordering.',NULL,'asset_request'),(3,'FleetGuru','Knowing whether incident are preventable opens opportunities to training, lower insurance rates and reduced liability',NULL,'incidents'),(4,'FleetGuru','Having an asset grave yard is leaving money on the table. ',NULL,'asset_removal'),(5,'FleetGuru','Things happen, but tracking the number of resolved and unresolved issues can help you better manage your asset utilization and minimize downtimes.',NULL,'issues'),(6,'FleetGuru','Fuel providers offer volume discounts. Do you qualify? Are you eligible for more?',NULL,'fuel_orders'),(7,'FleetGuru','Are you tired of countless paper reports? Conveniently complete and submit your daily checks digitally through the system.  ',NULL,'operators'),(8,'FleetGuru','By documenting everything digitally you can continuously monitor KPIs',NULL,'fleet_at_a_glance'),(9,'FleetGuru','Managing the utilization of your inventory will provide opportunities to possibly relocate or repurpose an existing asset rather than purchase a new one ',NULL,'asset_transfer'),(10,'FleetGuru','Are you paying for something you shouldnt? Make sure you check your warranty first. Not only the manufacturers warranty on newer assets. If it is a reoccurring problem, vendors usually carry a small warranty period on their work.',NULL,'repairs'),(11,'FleetGuru','Older assets can use more fuel for several reasons. A repair is necessary or asset is working too hard (no longer fit for purpose) plus new models are more efficient . ',NULL,'fuel_tracking');

